import React, { Component } from 'react';
import TodoListTemplate from './components/TodoListTemplate';
import Form from './components/Form';

class App extends Component {
  render() {
    return (
      <TodoListTemplate form={<Form/>}>
        기초 베이직 템플릿
      </TodoListTemplate>
    );
  }
}

export default App;
